import React, { useEffect } from 'react'
import { useParams } from 'react-router-dom'
import { Box } from '@mui/material';
import proto from '../pb/proto_grpc_web_pb';

var subastaService = new proto.SubastaServiceClient('http://0.0.0.0:8000');

export default function JoinSubasta(){
    const { id } = useParams();

    function GetSubasta(){
        let request = new proto.SubastaId()
        request.setId(id)
        let metadata = {};
        subastaService.getSubasta(request, metadata, (r, e) =>{
            console.log(r.getSubasta())
        });
    }

    function getSubastas() {
        var request = new proto.Empty();
        var metadata = {};

        subastaService.getSubasta(request, metadata, (err, response) => {
          if (err) {
            console.log(err.code, err.message);
          } else {
            let subasta = response.getSubasta();
            console.log(subasta);
          }
        });
      }

    useEffect(()=>{
        GetSubasta();
    }, [])

    return (
        <>
            <Box sx={{ paddingTop: 4 }}>
            <div>JoinSubasta - {id}</div>
            </Box>
        </>
    )
}
